import React, { useEffect, useState } from 'react';
import axios from 'axios';

const UserProfile = () => {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    axios.get('http://26.90.237.200:3000/user/read')
      .then(response => {
        setUsers(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <div className="container">
      <div>
        {users.map((user, idx) => (
          <div className="card" key={idx}>
            <div className="content">
              <p>user_id: {user.user_id}</p>
              <p>user_name: {user.user_name}</p>
              <p>user_lastname: {user.user_lastname}</p>
              <p>user_address: {user.user_address}</p>
              <p>user_age: {user.user_age}</p>
              <p>user_phone: {user.user_phone}</p>
              <p>user_email: {user.user_email}</p>
              <p>user_password: {user.user_password}</p>
              <p>status_authen: {user.status_authen}</p>
            </div>
            <div className="content">
              <br />
              <br />
              <br />
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default UserProfile;
